import Main_Section from "./components/Main_Section";
import Service from './components/Service';
import Trusted from './components/Trusted';
import Footer from './Footer';
import FeatureProduct from "./FeatureProduct";
const Home = () => {
  const data = {
    name : "grocery store",
  };
  const para = {
    paraData : "The best online grocery store in India. bigbasket is an online supermarket for all your daily needs. Online shopping now made easy with a wide range of",
  };
  return (
   <>
     <Main_Section myData={data} para={para}/>
     <FeatureProduct/>
     <Service/>
     <Trusted/>

   </>
  )
}

export default Home;
